import React from "react";
import ActionPanel from "./components/ActionPanel";
import OutputPanel from "./components/OutputPanel";
import CodePanel from "./components/CodePanel";
import MessagePanel from "./components/MessagePanel";
import { StateProvider } from "./context/StateContext";
import "./style.css"; // Ensure this import points to your static folder correctly if needed in build.

const App = () => {
  return (
    <StateContextProvider>
      <div className="grid-container">
        {/* Action Panel (Left Column spanning 2 rows) */}
        <div className="panel" style={{ gridRow: "1 / span 2" }}>
          <ActionPanel />
        </div>

        {/* Output Panel (Middle Column spanning 2 rows) */}
        <div className="panel" style={{ gridRow: "1 / span 2" }}>
          <OutputPanel />
        </div>

        {/* Message Panel (Top Right) */}
        <div className="panel">
          <MessagePanel />
        </div>

        {/* Code Panel (Bottom Right) */}
        <div className="panel">
          <CodePanel />
        </div>
      </div>
    </StateContextProvider>
  );
};

export default App;
